        const canvas = document.getElementById('mapCanvas');
    const ctx = canvas.getContext('2d');

    const cellSize = 10; // Each character represents a 3x3 pixel cell
    const mapWidth = 500;
    const mapHeight = 400;

    function drawMap() {
      for (const key in MAP) {
        if (MAP.hasOwnProperty(key)) {
          const [x, y] = key.split(',').map(Number);

          // Skip invalid coordinates
          if (isNaN(x) || isNaN(y)) {
            continue;
          }

          const cellX = (x + 9) * cellSize; // Center the map on the canvas
          const cellY = (9 - y) * cellSize; // Invert Y-coordinate

          // Draw rectangles for '#' characters
          if (MAP[key] === '#') {
            ctx.fillStyle = '#000'; // Black color for '#' characters
            ctx.fillRect(cellX, cellY, cellSize, cellSize);
          } else {
            // Draw a contrasting color for '.' characters
            ctx.fillStyle = '#0FF'; // White color for '.' characters
            ctx.fillRect(cellX, cellY, cellSize, cellSize);
          }
        }
      }
    }

    drawMap();
